import React from 'react';

//Importacion de listas de cards
import ListGroup from "react-bootstrap/ListGroup";
import Card from "react-bootstrap/Card";

//Importacion de listas de cards
import { Button } from "react-bootstrap";

function Tiket() {
  return (
    <div>
        {/* Sesion tarejtas */}
        <Card
            style={{ width: "18rem", height: "auto" }}
            clasName="text-center bg-info">
                
            <Card.Body>
              <Card.Title>Nivel Basico - Intermedio </Card.Title>

              <ListGroup variant="flush">
                <ListGroup.Item>
                  {" "}
                  Internet Check, Tigo Compra 100 Megas recibe 300 Megas{" "}
                </ListGroup.Item>
              </ListGroup>
              <Card.Text></Card.Text>

              
            </Card.Body>
          </Card>
    </div>
  )
}

export default Tiket
